import { ContainerS5,ContainerCenter,Paragrafo,Titulo, ContainerInput, Input, Botao} from "./styles";
import Imagem from "../../../assets/img/"
export default function S5(){
    return(
        <ContainerS5>
            <ContainerCenter>
                <Titulo>como funciona</Titulo>
                <Paragrafo>
                    Lorem ipsum dolor sit amet,consecteteu.
                </Paragrafo>
                <ContainerInput>
                    <Input type="email"></Input>
                    <Botao>Enviar</Botao>
                </ContainerInput>
            </ContainerCenter>
        </ContainerS5>
    )
}
